window.bookSummaryJSON = "<p>Explosions, body parts, and black magic are all part of Abby Collins' typical day. As the top Paranormal Investigation Bureau agent, she only gets the best cases, but when the Cult of Ra comes to play she might in be over her head. Finding a murderer while up against a hex, an overprotective coven, and a stubborn werewolf reminds her that nothing in the paranormal world is easy. As the death toll rises and a decades-old crime, linked to Abby, is uncovered, disturbing information is brought to light. Abby must unlock an ancient language steeped in black magic to uncover the truth before the murderer comes for her. </p>"; 
